<?phpnamespace Nemundo\App\ModelDesigner\Com\ListBox;use Nemundo\Admin\Com\ListBox\AdminListBox;use Nemundo\App\ModelDesigner\ModelDesignerConfig;use Nemundo\App\ModelDesigner\Parameter\ProjectParameter;use Nemundo\App\ModelDesigner\Project\DefaultProject;class ProjectListBox extends AdminListBox{    protected function loadContainer()    {        $this->label = 'Project';        $this->name = (new ProjectParameter())->parameterName;        $this->searchMode = true;        foreach ((new ModelDesignerConfig())->getProjectCollection()->getProjectList() as $project) {            $this->addItem($project->projectName, $project->project . ' (' . $project->namespace . ')');        }        $project = (new DefaultProject())->getDefaultProject();        if ($project !== null) {            $this->value = $project->getClassName();        }        parent::loadContainer();    }    public function getProject()    {        $project = (new ProjectParameter())->getProject();        return $project;    }}